import React, { Component } from 'react';
import './App.css';
import Register from './Register'

class App extends Component {
  constructor(){
    super();
    this.state ={
      municipalities:[],
      barrios:[]
    }
  }
  getMunicipalities = async()=>{
    try{
      const response = await fetch('http://localhost:8000/api/v1/auth/municipalities')

      if(response.status !== 200){
          throw Error(response.statusText);
          }

          const municipalitiesParsed = await response.json();
          const data = municipalitiesParsed.data
          const municipalities = data.map((municipality) => {
            return {
              municipality: municipality[municipality.length-1] 
            }
           })
          this.setState({
            municipalities: municipality
          })
    }catch(err){
      console.log(err);
    }
  }
  render(){
    console.log(this.state.municipalities);
  return (
    <div className="App">
      <h1>YUCAJU-App</h1>
      <Register getMunicipalities={this.getMunicipalities()}/>
    </div>
  );
}
}

export default App;
